} else if (action == 1 || action == 2){
    retval = (current_time - start) / (1000 * 60);
}

emit(retval);"}},"overall_duration":{"type":"keyword","script":{"source":"def retval = 0;
def current_time = new Date().getTime();
def termination = doc['event.payloadData.terminationTimestamp'].value;
def start = doc['event.payloadData.startTimestamp'].value;
def action = doc['event.payloadData.action'].value;

if (current_time > termination || action == 0) {
    retval = (termination - start) / (1000 * 60);
} else if (action == 1 || action == 2){
    retval = (current_time - start) / (1000 * 60);
}

if(retval <= 5){
    emit("<5 mins");
} else if(retval <= 15){
    emit("<15 mins");
} else if(retval <= 60){
    emit("<1 hr");
}else if(retval <= (60*12)){
    emit("<12 hrs");
}else if(retval <= (60*24)){
    emit("<24 hrs");
}else{
    emit(">24 hrs");
}"}}}

